import React, { useState } from "react";
import Layout from "antd/es/layout/layout";

const { Sider, Content } = Layout;
function App() {
  //const const [ collapsed, setCollapsed  ] = useState(false)

  return (
    <Layout>
      <Sider></Sider>
      <Layout>
        <Content></Content>
      </Layout>
    </Layout>
  );
}

export default App;
